import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
//Other Pages
import Home from './Home/Home';
import teacherProject from './teacherProjects/teacherProject';
import gridImages from'./teacherProjects/scratchGrid.jsx';
import TeacherSide from './ProjectBuilder1 - Teacher/TeacherSide';
import NavbarSidebar from './ProjectBuilder1 - Teacher/SideBar/NavbarSidebar';
import HelpRequest from './ProjectBuilder1 - Teacher/HelpRequest/helpRequest';


function App() {
  return (
    <Router>
    <div className="App">
      <switch>
      <Route path="/" exact component={Home}/>
      <Route path='/TeacherSide' component={TeacherSide} />
      <Route path='/' component={gridImages} />
      <Route path='/gridImages' component={gridImages} />
      <Route path="/teacherProject" component={teacherProject} />

      <Route path='/NavbarSidebar' component={NavbarSidebar} />
      </switch>
    </div>
    </Router>
  );
}

export default App;
